import React from "react";
import { Routes } from "react-router-dom";

function Home() {
  return (
    <main className="homepage">
      <h1>Hola!!</h1>
    </main>
  );
}

function Contact() {
  return (
    <main className="contact-me">
      <h1> Contact me here</h1>
    </main>
  );
}

function App() {
  return (
    <main className="main-container">
      <Routes>
        <Route path="/" element={<Home />} />
      </Routes>
    </main>
  );
}
export default App;
